Hacked
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Description: Hacked is a drama about cyber bullying and its effects. After Stoya learns that Kayden will be getting a promotion over her, she befriends Mr. Pete by giving herself to him in order to use him to hack into Kayden's social media accounts, phone, emails, and destroy her reputation. Day after day all of her friends and coworkers received sexual content and propositions from Kayden set up by her menace Stoya, who is out to get her at any cost. Even after having sex with her boss Giovanni Francesco on the factory floor, Kayden couldn't keep her job. What will she do next in order to get her life back?

Cast: Kayden Kross   Stoya   Ash Hollywood   Rikki Six   Mr. Pete   Bill Bailey   Giovanni Francisco   Carlo Carrera   Tony DeSergio

